INSERT INTO `email_notification` (`id`, `en_key`, `subject`, `text`, `send_to`, `send_cc`) VALUES
(1, 'activate_your_account', 'Please activate your account.', 'Dear {{first_name}} {{last_name}},\r\n <br/><br/>\r\nThank you for your interest in the {{company}}. Please click on the link below to verify your email address. <br />\r\n<a href=\"{{url}}\">Click Here</a>\r\n <br/><br/>\r\nOnce you verify your email address, you can take the free eligibility test and start your registration process.', 1, 'test_cc_qa@yopmail.com'),
(2, 'reset_password', 'Reset Your Password', 'Dear {{first_name}} {{last_name}},<br/><br/> You\'ve recently asked to reset the password for this {{company_name}} account: <br/>{{email}} <br/> <br/> To update your password, click on <a href=\"{{url}}\">this link</a>', 1, 'test_cc_qa@yopmail.com'),
(3, 'set_password', 'Set Your Password', 'Dear {{first_name}} {{last_name}},\r\n<br/>\r\n<br/>\r\nThank you for creating a new account with {{company_name}}, using the {{provider}} auto login feature.\r\n<br/>\r\n<br/>\r\nYou have the option to create a new password for your account now, by clicking on <a href=\"{{url}}\">this link</a>\r\n<br/>', 1, 'test_cc_qa@yopmail.com');
INSERT INTO `forum_category` (`id`, `parent_category_id`, `title`, `slug`, `banner_image`, `keyword`, `description`, `tags`, `status`, `created_at`, `updated_at`) VALUES
(1, 0, 'Family & Marriage Based US Visa Immigration Discussion', 'family-marriage-based-us-visa-immigration-discussion', 'images123.jpg', 'Family, Marriage, US, Visa', 'Discussion on the US immigration procedure to obtain a K1 Fiance(e) Visa for a non US Citizen (living overseas) engaged to a US Citizen. K2 Visas for children of the foreign fiance(e) (if applicable) are also discussed. test', '', 1, '2019-12-17 01:34:58', '2019-12-16 20:04:58'),
(2, 0, 'Non-Family Based US Visa Discussion', 'non-family-based-us-visa-discussion', 'images-1.jpg', 'Family, US, America', 'Discussion on the US immigration procedure to obtain a IR1 or CR1 Spouse Visa for a non US Citizen (living overseas) married to a US Citizen. IR2 and CR2 Visas for children of a foreign spouse are also discussed.', '', 1, '2019-12-17 01:34:08', '2019-12-16 20:04:08'),
(3, 0, 'Bringing Family Members of US Citizens to America', 'bringing-family-members-of-us-citizens-to-america', '523ccea6dc8cc01c48628e8a85e512c2.jpg', 'Citizens, America', 'Discussion on bringing a US Citizen\'s family members (other than a spouse or fiance) to America. This includes bringing children, parents, brothers and sisters. For spouses please see the K3 or IR-1 forums.\r\nDiscussion on bringing a US Citizen\'s family members (other than a spouse or fiance) to America. This includes bringing children, parents, brothers and sisters. For spouses please see the K3 or IR-1 forums.\r\nDiscussion on bringing a US Citizen\'s family members (other than a spouse or fiance) to America. This includes bringing children, parents, brothers and sisters. For spouses please see the K3 or IR-1 forums.\r\nDiscussion on bringing a US Citizen\'s family members (other than a spouse or fiance) to America. This includes bringing children, parents, brothers and sisters. For spouses please see the K3 or IR-1 forums.\r\nDiscussion on bringing a US Citizen\'s family members (other than a spouse or fiance) to America. This includes bringing children, parents, brothers and sisters. For spouses please see the K3 or IR-1 forums.', '', 1, '2019-12-16 04:02:42', '2019-12-15 22:32:42'),
(4, 3, 'What Visa Do I Need - Family Based Immigration', 'what-visa-do-i-need-family-based-immigration', 'download-3.jpg', 'visa, Immigration, family', 'Discussion on family based US visa options. test', '', 1, '2019-12-17 04:22:20', '2019-12-16 22:52:20'),
(5, 1, 'Tourist Visas', 'tourist-visas', 'images.jpg', 'Tourist, family', 'Discussion on B1 and B2 tourist visas as well as Border Crossing Cards to the US. People wishing to enter temporarily for pleasure, tourism, business or medical treatment should post here.', '', 1, '2019-12-17 03:19:08', '2019-12-31 06:33:53'),
(6, 0, 'Diversity Lottery Visas', 'diversity-lottery-visas', 'ck4nsg.jpg', 'Diversity', 'The Diversity Immigrant Visa Program makes available visas annually, drawn from a random selection among all entries from eligible countries. This is an immigrant visa that allows a direct path to becoming a US Permanent Resident.', '', 1, '2019-12-16 01:47:27', '2019-12-31 06:33:56'),
(7, 0, 'Adjustment of Status from Work, Student, & Tourist Visas', 'adjustment-of-status-from-work-student-tourist-visas', 'image111.jpg', 'Adjustment, Status', 'Discussion on filing for Adjustment of Status (AOS) from a Work, Student, Tourist Visa and other US Visas. Please post your interview experiences in the review section.', '', 1, '2019-12-16 22:59:16', '2019-12-31 06:33:59'),
(8, 0, 'Working & Traveling During US Immigration', 'working-traveling-during-us-immigration', '0266554465.jpg', 'Traveling, Immigration', 'Discussion on working and traveling for US immigrants both before and after obtaining US Permanent Residence. Employment Authorization Documents (EAD), Advance Parole (AP) and Social Security Numbers (SSN) (in its sub-forum) are discussed here.', '', 1, '2019-12-16 22:59:45', '2019-12-31 06:34:02'),
(9, 0, 'Tax & Finances During US Immigration', 'tax-finances-during-us-immigration', 'download-3.jpg', 'Finances, Tax', 'Discussion on Tax and Financial Topics Relating to US Immigration.', '', 1, '2019-12-16 23:00:11', '2019-12-31 06:34:05'),
(10, 0, 'US Citizenship General Discussion', 'us-citizenship-general-discussion', 'images1234.jpg', 'Citizenship, general', 'Discussion on filing for Naturalization (N-400) to become a US Citizen. This is for anyone wishing to become a US Citizen despite how they entered the US.', '', 1, '2019-12-16 23:00:35', '2019-12-31 06:34:07'),
(11, 0, 'Military Immigration-Related Discussion', 'military-immigration-related-discussion', 'saturn-day-earth-smiled-1000x600.jpg', 'Military, Discussion', 'Discussion on US immigration for US military members and their families.', '', 1, '2019-12-16 23:01:05', '2019-12-31 06:34:10');
